            <img src={`https://robohash.org/${id}?size=200x200`} alt= "robots" ></img>
            <Fragment>
                <h2 className ="tc"> {name} </h2>
                <p className = ""> {email} </p>
            </Fragment>
        </div>
     );
 }

export default Card;
